--liquibase formatted sql
--changeset drop_create_table_author:1
drop table if exists authors;

create table authors
(
    id bigserial primary key,
    first_name varchar (255),
    last_name varchar (255)
);

--changeset fill_table_author:2

--changeset drop_create_table_books:3
drop table if exists books;

create table books
(
    id bigserial primary key,
    pub_date date,
    is_bestseller integer,
    slug varchar (255),
    title varchar (255),
    image varchar (255),
    description text,
    price bigint,
    discount numeric,
    author_id bigint,
    constraint fk_author foreign key(author_id) references authors(id)
);

--changeset fill_table_books:4



